import React, {useState} from "react";
import {Container, Row, Col} from "reactstrap";

const Camera = () => {
	const [breadcrumbItems, setbreadcrumbItems] = useState({
		breadcrumbItems: [
			{title: "Nazox", link: "#"},
			{title: "Dashboard", link: "#"},
		],
	});

	return (
		<div>
			<h1>Soy Camera</h1>
		</div>
	);
};

export default Camera;
